import React from "react"

class Izvestaji extends React.Component{
    constructor(){
        super()
        this.state = {
            izvestaji:[],
            pocetak:"",
            kraj:""
        }
        this.handleChange=this.handleChange.bind(this)
        this.handleClick=this.handleClick.bind(this)
    }

    handleClick(){
        console.log(this.state)
    }

    handleChange(event){
        const {name,value} = event.target
        this.setState({
            [name]:value
        })
    }

    render(){
        return(
            <div id="izvestaji">
                <table>
                    <tbody>
                        <tr>
                            <td>Pocetak izvestaja:</td>
                            <td><input onChange={this.handleChange} type="datetime-local" name="pocetak"/></td>
                        </tr>
                        <tr>
                            <td>Kraj izvestaja:</td>
                            <td><input onChange={this.handleChange} type="datetime-local" name="kraj"/></td>
                        </tr>
                        <tr>
                            <td></td>
                            <td><button onClick={this.handleClick}>Kreiraj izvestaj</button></td>
                        </tr>
                    </tbody>
                </table>
            </div>
        )
    }
}

export default Izvestaji
